import React, {useState} from 'react';
import {
    Container,
    FormContainer,
    Title,
    InputLabel,
    Input,
} from '../styles/LoginStyles';
import axios from 'axios';

export default function Login() {
    const [Email, setEmail] = useState<String>("");
    const [Username, setUsername] = useState<String>("");
    console.log(Username)

    return (
        <Container>
            <FormContainer>
                <Title>Login</Title>
                <InputComponent
                    name={'Email'}
                    placeholder='Write your email'
                    type='email'
                    callbackFunction={setUsername}
                />

                <button onClick={console.log(Username)}>save</button>
                {/* <InputComponent name='correo' /> */}
            </FormContainer>
        </Container>
    );
}

function InputComponent({
    name,
    placeholder,
    type,
    callbackFunction,
}: {
    name: string;
    placeholder: string;
    type: 'email' | 'name' | 'number';
    callbackFunction: (newValue: string) => void;
}) {
    return (
        <>
            <InputLabel>{name}</InputLabel>
            <Input
                type={type}
                placeholder={placeholder}
            />
        </>
    );
}
